import React, { useState } from "react";
import AddUser from "./components/AddUser";

const [NewUser, setNewUser] = useState([
  { id: 1, userName: "Jorge", age: "32" },
]);

function App() {
  return (
    <div>
      <AddUser user={NewUser} />
    </div>
  );
}

export default App;
